	u64 ts = bpf_ktime_get_ns();
	struct piddata* piddatap;
	struct piddata new_piddata = {.start_ts = 2};
	int ret = 0;
	if (allow_record(flags) && record_launch()) {
		u32 pid = p->pid;
		piddatap = bpf_map_lookup_elem(&start, &pid);
